import React from "react";
import styles from "./ShoppingCarPage.module.css";
import User from "../../components/user/user";

interface Goods {
  id: number;
  name: string;
  price: number;
  img: string;
}

interface CartItem {
  goods: Goods;
  quantity: number;
}

const ShoppingCarPage: React.FC<CartItem[]> = (goods: CartItem) => {
  return (
    <div>
      <User />
      <div className={styles.container}>
        <div className={styles.title}></div>
        <table>
          <tr>
            <th>图片</th>
            <th>商品</th>
            <th>价格</th>
            <th>商家邮箱</th>
          </tr>
        </table>
      </div>
    </div>
  );
};

export default ShoppingCarPage;
